import React, { Component } from 'react';
import { Field, reduxForm } from 'redux-form';

class SearchBar extends Component {
  renderInput({ input }) {
    console.log(input);

    return <input {...input} />;
  }

  render() {
    return (
      <form>
        <Field name="Zipcode | City " component={this.renderInput} />
      </form>
    );
  }
}

export default reduxForm({
  form: 'submittedSearch'
})(SearchBar);
